function float2dollar(t){return"U$ "+t.toFixed(2).replace(/\d(?=(\d{3})+\.)/g,"$&,")}function renderChart(t,a){var e=document.getElementById("myChart").getContext("2d");new Chart(e,{type:"line",data:{labels:a,datasets:[{label:"This week",data:t,borderColor:"rgba(75, 192, 192, 1)",backgroundColor:"rgba(75, 192, 192, 0.2)"}]},options:{scales:{yAxes:[{ticks:{beginAtZero:!0,callback:function(t,a,e){return float2dollar(t)}}}]}}})}function getChartData(){$.ajax({url:"http://localhost:3004/chartdata",success:function(t){$("#loadingMessage").html("");var a;a=t.thisWeek,console.log(a),renderChart(a,t.labels)},error:function(t){$("#loadingMessage").html("Error")}})}$("#renderBtn").click(function(){getChartData()});